import { Route, Router} from "react-router-dom";
import {Home} from "../pages/Home"
import {Iphone} from "../pages/Iphone"
import React from "react";



export function Nav() {
    return (
        <Router>
            <div calssName='Nav'>
                <Nav/>
                
                    <Route path="/" component={Home}/>
                    <Route path="/iphone" component={Iphone}/>
                
            </div>
        </Router>
    )
}
